    /**
    * @param integer amount
    * @param integer time
    * @return array
    */

    public function smartcredit($amount,$time)
    {
        $commision = round(($this->max_interest_rate_day/100)*$amount*$time);        
                
        return [
            'id' => $this->id,
            'amount' => $amount,
            'commision' => $commision,
        ];
    }

    /**
    * @param integer amount
    * @param integer time
    * @return array
    */

    public function centrzaimov($amount,$time)
    {
        if ($amount <= 7000 && $time <= 7) {
            $commision = 0;
        }else{
            $commision = round(($this->max_interest_rate_day/100)*$amount*$time);        
        }

        return [
            'id' => $this->id,
            'amount' => $amount,
            'commision' => $commision,
        ];
    }

    /**
    * @param integer amount
    * @param integer time
    * @return array
    */

    public function centrofinans($amount,$time)
    {
        $commision = round(($this->max_interest_rate_day/100)*$amount*$time);        
        
        if ($time >= 21) {
            $commision -= round(($this->max_interest_rate_day/100)*$amount*7);
        }

        return [
            'id' => $this->id,
            'amount' => $amount,
            'commision' => $commision,
        ];
    }

    /**
    * @param integer amount
    * @param integer time
    * @return array
    */

    public function slovo($amount,$time)
    {
        $commision = round(($this->max_interest_rate_day/100)*$amount*$time);        
        
        return [
            'id' => $this->id,
            'amount' => $amount,
            'commision' => $commision,
        ];
    }

